import React, { useEffect, useState } from 'react';

const OrderList = () => {
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8080/getAllOrders")
      .then(response => response.json())
      .then(data => {
        console.log('Fetched data:', data);  // Debug: log the fetched data
        if (Array.isArray(data)) {
          setOrders(data);
        } else {
          console.error('Data is not an array:', data);
        }
      })
      .catch(error => console.error('Error fetching orders:', error));
  }, []);
//setOrders(data)
  return (
    <div className="container mt-4">
      <h2>All Orders Data</h2>
      <table className="table table-striped table-hover">
        <thead>
          <tr>
            <th>Order ID</th>
            <th>Consumer Name</th>
            <th>Product Name</th>
            <th>Date</th>
          </tr>
        </thead>
        <tbody>
          {orders.map(order => (
            <tr key={order.order_id}>
              <td>{order.order_id}</td>
              <td>{order.consumer ? order.consumer.first_name : 'Unknown'}</td>
              <td>{order.product ? order.product.model.model_Name : 'Unknown'}</td>
              <td>{order.date_of_order}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default OrderList;
